import React, {useState, useEffect} from 'react';
import mobil from '../images/mobil.jpg'
import axios from 'axios';

const Dashboard = () => {
  const [mobil, setMobil] = useState([]);

useEffect(()=> {
  getMobil();
}, []);

const getMobil = async () => {
const response = await axios.get("http://localhost:5000/mobil");
  setMobil(response.data);
};

  return (
    
      <div className="container">
        <div class="card card-solid">
          <div class="card-body pb-0">
            <div class="row">
            {mobil.map((mobil, index)=> (
            <React.Fragment key={mobil.id}>
              <div class="col-sm-4 mb-5"key ={mobil.id}>
                <div class="card bg-light d-flex flex-fill">

                  <div class="card-header border-bottom-0">
                    <h2 class="lead"><b>{mobil.nama}</b></h2>
                    <p class="text-muted text-sm"></p>
                  </div>

                  <div class="card-body pt-0">
                    <div class="row">

                      <div class="col-12 text-center">
                        <img className='img-fluid' src="https://2.bp.blogspot.com/-S6a7IgrE-Ow/UtBqkt2VXVI/AAAAAAAAA8o/ZiaoVpm0iNM/s1600/Gambar-gambar+mobil+lamborghini+Paling+Terbaru+dan+rilis+Di+tahun+2014+ini+2.jpg" />
                      </div>
                    </div>
                  </div>

                  <div class="card-footer">
                    <div class="row">
                      <div class="col-sm-6">
                        <div class="text-start">
                          <p>{mobil.harga}</p>
                        </div>
                      </div>
                      <div class="col-sm-6">
                        <div class="text-end">
                          <button type="submit" class="btn btn-sm btn-danger">
                            <i class="fas fa-shopping-cart"></i> Add To Cart
                          </button>
                        </div>
                      </div>
                    </div>
                  </div>

                </div>
              </div>
              </React.Fragment>
            ))}
          </div>
        </div>
      </div>
    </div>
  )
}

export default Dashboard
